ll-Trades"},"post_url":"/t/advantagekit-setup-resource-leak/461058/2","custom_user_title":"3181/3015 Mentor | 213/1373 Alum | CSA/FTAA/Jack-of-all-Trades","reactions":[],"current_user_reaction":null,"reaction_users_count":0,"current_user_used_main_reaction":false,"can_accept_answer":false,"can_unaccept_answer":false,"accepted_answer":false,"topic_accepted_answer":true},{"id":3351074,"name":"","username":"SirFire","avatar_template":"/user_avatar/www.chiefdelphi.com/sirfire/{size}/222590_2.png","created_at":"2024-04-03T02:15:06.759Z","cooked":"<p>Yes, that is what I thought too, and I didn’t understand how simply instantiating a <code>PowerDistribution</code> would enable power distribution logging. Nonetheless, the AdvantageKit guide linked in my original post said to include it, so I did, but I do find it weird that nobody else would bring it up.<br>
This is my entire <code>Robot.java</code> file if that is helpful.</p>
